    constructor(props) {
        super(props)

        this.state = {

            ...this.props.support.attributes

        }
    }

    saveClickHandler = () => {
        this
            .props
            .modalClicked(false, null);

   let tempFeature = {...this.props.support};
   tempFeature.attributes = {...this.state};

        this
            .props
            .saveSupport(tempFeature, this.props.config.featureURLs);
        

    }

    cancelClickHandler = () => {
        this
            .props
            .modalClicked(false, null)
    }

